<template>
  <div id="regist-container">
    <div class="container">
      <div class="registTitle">注册</div>
      <div class="text-container">
        <span class="name">用户名</span>
        <el-input
          placeholder="请输入内容"
          v-model="registUsername"
          id="nameInput"
        >
        </el-input>
        <span class="password">密码</span>
        <el-input
          placeholder="请输入密码"
          v-model="registPassword"
          show-password
          id="passInput"
        ></el-input>
        <el-row>
          <el-button
            type="primary"
            round
            id="registBtn"
            @click="registHandler"
            :loading="isLoading"
            >注册</el-button
          >
        </el-row>
        <div class="toLogin">
          <el-link type="primary" @click="goLogin">去登录</el-link>
        </div>
      </div>
    </div>
  </div>
</template>

<script>
import axios from "axios";
import url from "@/service.config.js";
import { mapActions } from "vuex";

export default {
  data() {
    return {
      registUsername: "",
      registPassword: "",
      isLoading: false,
    };
  },
  methods: {
    goLogin() {
      this.$router.push("/login");
    },
    ...mapActions(["loginAction"]),
    registHandler() {
      console.log("注册");
      this.isLoading = true;
      if (this.registPassword == "" || this.registUsername == "") {
        this.$alert("用户名或密码不能为空！", "Tips", {
          confirmButtonText: "确定",
        });
        this.isLoading = false;
      } else {
        axios({
          url: url.registUser,
          method: "post",
          data: {
            userName: this.registUsername,
            passWord: this.registPassword,
            userImg:
              "data:image/jpeg;base64,",
          },
        })
          .then((res) => {
            if (res.data.code == 200) {
              const h = this.$createElement;
              this.$notify({
                title: "注册信息",
                message: h("i", { style: "color: teal" }, "恭喜，注册成功！"),
                duration: 2000,
              });
              this.registUsername = this.registPassword = "";
              this.isLoading = false;
              this.$router.push('/login');
            } else {
              const h = this.$createElement;
              this.$notify({
                title: "注册信息",
                message: h(
                  "i",
                  { style: "color: teal" },
                  "用户名重复啦，请重试！"
                ),
                duration: 2000,
              });
              this.isLoading = false;
            }
          })
          .catch((err) => {
            const h = this.$createElement;
            this.$notify({
              title: "注册信息",
              message: h(
                "i",
                { style: "color: teal" },
                "抱歉，出现了一点问题！"
              ),
              duration: 2000,
            });
            this.isLoading = false;
          });
      }
    },
  },
};
</script>

